import { Button } from '@material-ui/core'
import React from 'react'

function Popupsingin(props){
    return (props.trigger) ? (
        <div className = 'popup'>
            <div className = 'popup-inner'>
                <Button className = 'close-btn'>
                    close
                </Button>
                {props.children}
            </div>
        </div>
    ) : "";
}

export default Popupsingin
